import React from 'react';
import ReactDOM from 'react-dom';

const tasks = ['take out trash', 'do something', 'go fuck yourself'];

const element =
<ol>
  { tasks.map((task) => <li>task</li>) }
</ol>





ReactDOM.render(element, document.getElementById('root'));
